import React from 'react';
import Container from 'react-bootstrap/Container';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import Image from 'react-bootstrap/Image';
import '../components/ProjectCard.css'
import Rose from '../components/rose.jpg';

const ProjectCard = () => (
<Container className="projectContainer">
  <Row >
    <Col xs={6} >

      <Image style={{width: 250, display:'inline-block', margin: 'auto'}} src={Rose} rounded />


     <Col className="Col">
     <p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit.
      Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. 
      Donec quam felis, ultricies nec, pellentesque eu, pretium quis, sem. Nulla consequat massa quis enim.</p>
      </Col>


     </Col>
    </Row>


    </Container>
)

export default ProjectCard;
